import React from "react";
import { List } from "antd";

const data = [
  { title: "Rice", quantity: "20rs/KG" },
  { title: "Rice", quantity: "20rs/KG" },
  { title: "Rice", quantity: "20rs/KG" }
];
class SellPage extends React.Component {
  render() {
    return (
      <>
        Sell Page
        {data.map(item => {
          return (
            <div>
              <List
                itemLayout="horizontal"
                bordered
                dataSource={data}
                renderItem={item => <List.Item>{item.title}</List.Item>}
              />
            </div>
          );
        })}
      </>
    );
  }
}

export default SellPage;
